import '../global_css/video_css/styles.css'

const poster = [
  "/Assets/Images/video-list-0.jpg"
]

class Video extends React.Component {
  render() {
    return (
      <video poster={poster}>
        <div></div>
      </video>
    )
  }
}

export default Video
